import CalculatedList from "./CalculatedList";

const ResultTable = (props) => {
    if(!props.valid) {
        return (
            <p>No investment calculated yet.</p>
        );
    } else {
        return (
            <CalculatedList userInput={props.userInput} />
        );
    }
};

export default ResultTable;
